import './main.css';
import { BrowserRouter, Route, Routes } from 'react-router-dom';

import { Usuario } from './Components/Usuario';
import { VentanaBase } from './Components/VentanaBase';

function App() {
  return (
    <div className='App'>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Navigate to="/login" />} />
          <Route path="/Administrador" exact Component={VentanaBase} />
        </Routes>
        <div className='Recuadro'>
          <Usuario />
        </div>
      </BrowserRouter>
    </div>
  );
}

export default App;
